def newmember(request):
    if request.method == 'POST':
        form = GolferInfo(request.POST)
        if form.is_valid():
            form.save()
            return redirect('/PRGCdatabase/home')
        else:
            form = GolferInfo()
            return render(request, 'PRGC/newgolfer.html', {'form': form})
    else:
        form = GolferInfo()
        return render(request, 'PRGC/newgolfer.html', {'form': form})


def member_info_existing(request):
    queryset = MemberInfo.objects.all().exclude(memberid=1)
    search_term = ''
    if 'search' in request.GET:
        search_term = request.GET['search']
        queryset = queryset.filter(Q(memberid__icontains=search_term)
                                   | Q(firstname__icontains=search_term)
                                   | Q(lastname__icontains=search_term))
    paginator = Paginator(queryset, 13)  # Show 6 contacts per page
    page = request.GET.get('page')
    queryset = paginator.get_page(page)
    context = {"object_list": queryset, "search_term": search_term}
    return render(request, 'PRGC/member_info_existing.html', context)


def memberinfo(request, memberid):
    instance = MemberInfo.objects.get(memberid=memberid)
