def playing(request, memberid=None):
    instance = MemberInfo.objects.get(memberid=memberid)
    queryset = MemberInfo.objects.filter(memberid=memberid)
    form = PlayingMembers(request.POST or None, instance=instance)
    if form.is_valid():
        instance = form.save(commit=False)
        instance.save()
        context2 = {
            "instance": instance,
        }
        return render(request, 'PRGC/newgame.html', context2)
    context = {
        "instance": instance,
        "form": form,
        "object_list": queryset,
    }
    return render(request, 'PRGC/playing.html', context)


